def get_wind_schedule(maxv, count, sigma, cut, power):
    day = []
    value = 0
    for i in range(96):
        r = np.random.normal(0, pow(sigma, 0.5))
        for j in range(2):
            value = abs(min(maxv, value + r))
            day.append(int(pow(value, 3) / 10))
    schedule = get_schedule(np.array(day[96:]), count, power, cut)
    return schedule


